import React, { Component } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

class Door extends Component {
  params = useParams();

  state = {
    id: 1,
    detail: {},
  };
  render() {
    return <div>{this.params.id}</div>;
  }

  async fetchDoorData() {
    try {
      const result = await axios.get(
        `http://127.0.0.1:5000/doors/${this.state.id}`
      );
      if (result.status === 200) {
        const alldoors = result.data.map((door) => ({
          id: door[0],
          name: door[1],
          dateTime: door[2],
          address: `${door[4]}, ${door[5]}, ${door[6]}, ${door[7]}, ${door[8]}`,
        }));
        this.setState({ alldoors });
      }
    } catch (error) {
      console.log("Could not fetch doors at this time:", error);
    }
  }
}

export default Door;
